const greenTheme = {
	colors: {
		background: '#ffffff',
		opposite: '#272727',

		Primary: '#F5FEEC',
		Secondary: '#D7F2BA',
		Tertiary: '#B9E8A0',
		Quaternary: '#9CC69B',
		Quinary: '#6E8F6D',
	},
};

export default greenTheme;
